import { createReducer, on } from '@ngrx/store';
import { deleteUserToken, setUserToken } from './auth.actions';
const initialAuthState = {
  userToken: undefined
};
export const AuthReducer = createReducer(initialAuthState, on(setUserToken, (state, {
  userToken
}) => ({
  ...state,
  userToken
})), on(deleteUserToken, state => ({
  ...state,
  userToken: undefined
})));
